import React from "react";
import styled from 'styled-components';
import Carousel from "@brainhubeu/react-carousel";
import "@brainhubeu/react-carousel/lib/style.css";
import one from '../../../img/lyft.jpg';
import two from '../../../img/lyft.jpg';
import tree from '../../../img/lyft.jpg';
import four from '../../../img/lyft.jpg';
import five from '../../../img/lyft.jpg';
import Paragraf from './ParagrafMain';
import Link from '../../Link';


const Item = styled.div`
a{
    color: #6772e5;
    font-size: 17px;
}
`
const Poster=styled.div`
  width: 1160px;
  height: 300px;
  position: relative;
  display: flex;

`

const TextBox=styled.div`
  width: 660px;
  height: auto;
  background: #fff;
  margin: 60px;


  p{
    font-size: 17px;
  }

`

const CaruselItem=styled.div`
margin: 10px 454px;
width: 1160px;
height: 300px;
position: relative;
top: 900px;
img{
  position: relative;
  width: 500px;
  height: auto;
  margin-top: 20px;
  padding-left: 0px;
  border-radius: 4%;

    border-style: solid;
    border-color: transparent transparent #ffc740;

    border-width: 0 0 340px 420px;
    bottom: -160px;
    right: 580px;


}
`

class Carusel extends React.Component {
  render(){
    return(
          <CaruselItem>
                <Carousel 
                slidesPerPage={1}
                slidesPerScroll={1}
                animationSpeed={1500}
                offset= {10}
                itemWidth={1160}
                clickToChange
                infinite
                arrows >


                    <Poster>
                        <img className='poster' src={one} alt="academy"/>
                        <TextBox>
                          <Paragraf text="With over 700,000 drivers providing nearly one million rides per day, Lyft uses Stripe to power payments at scale. Lyft also partnered with Stripe to build Express Pay, a first-of-its-kind feature that allows drivers to cash out whenever they want, instantly."/>
                          <Item className="arrow4"><Link text="Stripe status"/></Item>
                        </TextBox>
                    </Poster>
                    <Poster>
                        <img className='poster' src={two} alt="academy"/>
                        <TextBox>
                          <Paragraf text="With over 700,000 drivers providing nearly one million rides per day, Lyft uses Stripe to power payments at scale. Lyft also partnered with Stripe to build Express Pay, a first-of-its-kind feature that allows drivers to cash out whenever they want, instantly."/>
                          <Item className="arrow4"><Link text="Stripe status"/></Item>
                        </TextBox>
                    </Poster>
                    <Poster>
                        <img className='poster' src={tree} alt="academy"/>
                        <TextBox>
                          <Paragraf text="With over 700,000 drivers providing nearly one million rides per day, Lyft uses Stripe to power payments at scale. Lyft also partnered with Stripe to build Express Pay, a first-of-its-kind feature that allows drivers to cash out whenever they want, instantly."/>
                          <Item className="arrow4"><Link text="Stripe status"/></Item>
                        </TextBox>
                    </Poster>
                    <Poster>
                        <img className='poster' src={four} alt="academy"/>
                        <TextBox>
                          <Paragraf text="With over 700,000 drivers providing nearly one million rides per day, Lyft uses Stripe to power payments at scale. Lyft also partnered with Stripe to build Express Pay, a first-of-its-kind feature that allows drivers to cash out whenever they want, instantly."/>
                          <Item className="arrow4"><Link text="Stripe status"/></Item>
                        </TextBox>
                    </Poster>
                    <Poster>
                        <img className='poster' src={five} alt="academy"/>
                        <TextBox>
                          <Paragraf text="With over 700,000 drivers providing nearly one million rides per day, Lyft uses Stripe to power payments at scale. Lyft also partnered with Stripe to build Express Pay, a first-of-its-kind feature that allows drivers to cash out whenever they want, instantly."/>
                          <Item className="arrow4"><Link text="Stripe status"/></Item>
                        </TextBox>
                      </Poster>
                </Carousel>

        </CaruselItem>
    )
    }
}

export default Carusel;
